Do you like to play turn based strategy game? If so, what is your favorite?

I got a little glimpse on Mario + Rabbids!

Gotta hand to its gorgeous graphics and creative turn based strategy gameplay style.

It is a little weird to see Mario wielding a gun though. Gotta keep playing!

Nintendo and Ubisoft really have a good chemistry to produce this kind of bizarre cross-over.

